// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import AdminIndex from './components/AdminIndex';
import StudentLogin from './components/StudentLogin';
import DayscholarIndex from './components/DayscholarIndex';
import HostlerIndex from './components/HostlerIndex';

function App() {
  return (
    <Router>
      <div>
        <Navbar links={[
          { name: 'Admin Login', path: '/admin' },
          { name: 'Student Login', path: '/student-login' }
        ]} />
        <Routes>
          <Route path="/admin" component={AdminIndex} />
          <Route path="/student-login" component={StudentLogin} />
          <Route path="/dayscholar" component={DayscholarIndex} />
          <Route path="/hostler" component={HostlerIndex} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
